import "./Card.css"

function Card ({title, imgSrc, imgAlt, text, selectPage, path}){
    return (
        <>
            <div className="cat_card__pic">
                <img
                    src={imgSrc}
                    alt={imgAlt}
                />
            </div>
            <div className="cat_card__text">
                <h3 className="cat_card__title">{title}</h3>
                <p>{text}</p>

            </div>
            <div className="cat_card__subscribe">
                <button type="button" className="open_subscribe">
                    <a className="global-nav__link" href={path} onClick={e => {
                        selectPage(e);
                        setShowMenu(false);
                    }}>
                        "More Information About Us"
                    </a>
                </button>
            </div>
        </>
    )
}
export default Card;
